  input: 'TEXT,F3A,,"Connealy 04 Committee; Description of Treasurer''s Best Efforts.  Our
    first step is to inquire within the committee members.  I often can get the required
    information by asking Matt Connealy.  However, other members of the committee
    have been able to provide the required information.  When I am not able to obtain
    this information throught these means, Matt will call on the individual parties
    when we have phone numbers.  Our last attempt is by means of a letter signed by
    the candidate.  I tried attaching a copy of a recent letter, but it will not paste.  Therefore,
    the following is the verbage we have used in the past on our letters:  DEAR JEAN,
    THANK YOU VERY MUCH FOR YOUR RECENT CONTRIBUTION TO THE CONNEALY FOR CONGRESS
    CAMPAIGN.  BECAUSE FEDERAL LAW REQUIRES US TO USE OUR BEST EFFORTS TO COLLECT
    AND REPORT THE NAME, ADDRESS, EMPLOYER AND OCCUPATION OF INDIVIDUALS WHOSE CONTRIBUTIONS
    EXCEED $200 DOLLARS DURING AN ELECTION CYCLE, PLEASE COMPLETE AND THE ENCLOSED
    SELF-ADDRESSED REPLY CARD WITH THE REQUIRED INFORMATION AT YOUR EARLIEST CONVENIENCE....since
    space is limited I needed to cut it short.  I hope this helps for your documation.  Thanks,
    Terry Lage, Treasurer Connealy 04."'
